import React from 'react';

function PracticeTodo(){
    const arr = [1,2,3,4,5];
  return(
    <div>
      <h2>Basic of React js</h2>
      <ul>
      {
        arr.filter((val,i)=>{
          console.log(val);
          return <li>{val !== 2}</li>
            // <li key={i}>{val >= 2}</li>
          
        })
      }
        
      </ul>
      
    </div>
  )
}

export default PracticeTodo
